import '../styles/event.css'
import calendar from '../assets/calendar.svg'
import clock from '../assets/clock.svg'
import location from '../assets/location.svg'



function EventPage() {
    return (
        <div>
            <div className="page-name">
                <h1>Event Terbaru</h1>
            </div>
            <div className="event-container">
                <div className="event">
                    <div className="event-image">
                        <img src='data:image/jpeg;base64,' />
                    </div>
                    <div className="event-desc">
                        <div className="desc-left">
                            <div className="desc-time">
                                <div className="calendar">
                                    <img src={clock} />
                                    <p>12 Januari 2023</p>
                                </div>
                                <div className="clock ml-3">
                                    <img src={calendar} />
                                    <p>15:00</p>
                                </div>
                            </div>
                            <div className="desc-main">
                                <h2>Shining Matsuri 2023</h2>
                                <h3>HTM : Free</h3>
                                <p>Shining matsuri merupakan event besar tahuinan yang diadakan di trans smart jakarta</p>
                            </div>
                            <div className="location">
                                <img src={location} />
                                <p>Transmart Jakarta</p>
                            </div>
                        </div>
                        <div className="desc-right">
                            <div className="eo">
                                <p>by <strong>Nakama EO</strong></p>
                            </div>
                            <div className="guest-star">
                                <ul>
                                    <li>X</li>
                                    <li>X</li>
                                    <li>X</li>
                                </ul>
                            </div>
                            <div className="visit-ctr">
                                <a className="visit-btn" href="#">Visit</a>
                            </div>
                            <div className="visitor">
                                <p>Visitor : 560 People</p>
                            </div>
                        </div>
                    </div>
                </div>
                <div className="event">
                    <div className="event-image">
                        <img src='data:image/jpeg;base64,' />
                    </div>
                    <div className="event-desc">
                        <div className="desc-left">
                            <div className="desc-time">
                                <div className="calendar">
                                    <img src={clock} />
                                    <p>12 Januari 2023</p>
                                </div>
                                <div className="clock ml-3">
                                    <img src={calendar} />
                                    <p>15:00</p>
                                </div>
                            </div>
                            <div className="desc-main">
                                <h2>Shining Matsuri 2023</h2>
                                <h3>HTM : Free</h3>
                                <p>Shining matsuri merupakan event besar tahuinan yang diadakan di trans smart jakarta</p>
                            </div>
                            <div className="location">
                                <img src={location} />
                                <p>Transmart Jakarta</p>
                            </div>
                        </div>
                        <div className="desc-right">
                            <div className="eo">
                                <p>by <strong>Nakama EO</strong></p>
                            </div>
                            <div className="guest-star">
                                <ul>
                                    <li>X</li>
                                    <li>X</li>
                                    <li>X</li>
                                </ul>
                            </div>
                            <div className="visit-ctr">
                                <a className="visit-btn" href="#">Visit</a>
                            </div>
                            <div className="visitor">
                                <p>Visitor : 560 People</p>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    )
}

export default EventPage